import React from 'react';
import ReactDOM from 'react-dom';

class App extends React.Component{
  constructor(props){
    super();
    this.state = {isActive: true};
  }


  render(){

    return (
      <div>
        <h1>Hello, World!</h1>
      </div>
    )
  }
}

ReactDOM.render(
    <App
    />,
    document.getElementById('root')
);
